import React, { useRef } from "react";
import { useFormik } from "formik";
import * as yup from "yup";
import emailjs from "@emailjs/browser";
import "../css/Contact.css";
import jimPhoto from "../assets/mainPics/jim.jpg";
import mbLogo from "../assets/mainPics/MB-logo.png";
import facebookLogo from "../assets/mainPics/Facebook_Logo_Primary.png";

export default function Contact() {
  const formRef = useRef();
  const phoneRegExp = /^((\+[1-9]{1,4}[ \-]*)|(\([0-9]{2,3}\)[ \-]*)|([0-9]{2,4})[ \-]*)*?[0-9]{3,4}?[ \-]*[0-9]{3,4}?$/;

  const formik = useFormik({
    initialValues: {
      userFirstName: "",
      userLastName: "",
      userEmail: "",
      userPhoneNum: "",
      userMessage: "",
    },
    validationSchema: yup.object({
      userFirstName: yup.string().max(25).required("Required"),
      userLastName: yup.string().max(30).required("Required"),
      userEmail: yup.string().email("Invalid email").required("Required"),
      userPhoneNum: yup.string().matches(phoneRegExp, "Invalid phone").nullable(),
      userMessage: yup.string().max(300).required("Required"),
    }),
    onSubmit: async (_, { setSubmitting, resetForm }) => {
      try {
        await emailjs.sendForm(
          "service_pda4dyn",
          "template_4npi60d",
          formRef.current,
          "JiyFMUBN4XcgzPCpE"
        );
        alert("Your message was sent!");
        resetForm();
      } catch {
        alert("Oops—couldn’t send.");
      } finally {
        setSubmitting(false);
      }
    },
  });

  return (
    <section className="contactSection">
      <aside className="businessCard">
        <img src={jimPhoto} alt="Jim Stiltner" className="profileImg" />
        <h2>James A. Stiltner</h2>
        <a href="tel:7199643526">719‑964‑3526</a>
        <a href="mailto:jim@masterbilt.com">jim@masterbilt.com</a>
      </aside>

      <div className="formContainer">
        <img src={mbLogo} alt="Masterbilt" className="logo" />
        <h1>Contact Us</h1>

        <form ref={formRef} onSubmit={formik.handleSubmit} noValidate>
          <div className="row">
            <div className="field">
              <label htmlFor="userFirstName">First Name</label>
              <input {...formik.getFieldProps("userFirstName")} />
              {formik.touched.userFirstName && formik.errors.userFirstName && (
                <div className="error">{formik.errors.userFirstName}</div>
              )}
            </div>
            <div className="field">
              <label htmlFor="userLastName">Last Name</label>
              <input {...formik.getFieldProps("userLastName")} />
              {formik.touched.userLastName && formik.errors.userLastName && (
                <div className="error">{formik.errors.userLastName}</div>
              )}
            </div>
          </div>

          <div className="row">
            <div className="field">
              <label htmlFor="userEmail">Email</label>
              <input type="email" {...formik.getFieldProps("userEmail")} />
              {formik.touched.userEmail && formik.errors.userEmail && (
                <div className="error">{formik.errors.userEmail}</div>
              )}
            </div>
            <div className="field">
              <label htmlFor="userPhoneNum">Phone</label>
              <input type="tel" {...formik.getFieldProps("userPhoneNum")} />
              {formik.touched.userPhoneNum && formik.errors.userPhoneNum && (
                <div className="error">{formik.errors.userPhoneNum}</div>
              )}
            </div>
          </div>

          <div className="field">
            <label htmlFor="userMessage">Message</label>
            <textarea rows="6" {...formik.getFieldProps("userMessage")} />
            {formik.touched.userMessage && formik.errors.userMessage && (
              <div className="error">{formik.errors.userMessage}</div>
            )}
          </div>

          <button
            type="submit"
            className="submitBtn"
            disabled={formik.isSubmitting}
          >
            {formik.isSubmitting ? "Sending…" : "Send Message"}
          </button>
        </form>

        <div className="socials">
          <a
            href="https://www.facebook.com/MasterbiltHomes"
            target="_blank"
            rel="noopener noreferrer"
            className="socialLink"
          >
            <img src={facebookLogo} alt="" />
            Facebook
          </a>
          <a
            href="https://www.bbb.org/…"
            target="_blank"
            rel="noopener noreferrer"
            className="socialLink"
          >
            <img
              src="https://seal‑southerncolorado.bbb.org/…png"
              alt="BBB"
            />
          </a>
        </div>
      </div>
    </section>
  );
}
